import StocksDisplay from './components/recommendator/StocksDisplay';

function App() {
  return (
    <AuthContextProvider>
      <div className="App">
        <div className='header'>
        q<HeaderAppBar/>
        </div>

        {/* <StocksDisplay/> */}
        <div className='content'>
          <Recommender/>
        </div>

      </div>
    </AuthContextProvider>

  );
}

export default App;
